import React from 'react';
import ReactDOM from 'react-dom';

import Beer from './beer';


export default class BeerList extends React.Component<{beers:Array<string>}> {

    constructor(props:{beers:Array<string>}) {
        super(props);
    }

    render () {
        return(
            <div>
                <h2>Liste de bi√®res:</h2>
                <ul>
                    {this.props.beers.map((item,i) =>
                        <li key={i}>
                            <Beer name={item}/>
                        </li>
                    )}
                </ul>
            </div>
        );
    }
}
ReactDOM.render(
    <BeerList beers={["heineken", "filme mes pieds", "pas le temps de niaiser"]}/>,
    document.getElementById('root')
);
